import React from "react";

import { Container } from "./styles";

function SignIn() {
  return (
    <Container>
      <form action="#">
        <h1>Bem vindo!</h1>
        <div>
          <a href="#">facebook</a>
          <a href="#">google-plus</a>
          <a href="#">link</a>
        </div>
        <span>or use your account</span>
      </form>
    </Container>
  );
}

export default SignIn;
